import React, { Component } from 'react';
import {Form, Select, Slider, DatePicker} from 'antd';
import { AutoComplete } from 'antd';

import './SearchForm.css';


const Option = Select.Option;



class SearchForm extends Component {
    render() {
        const AntWrappedLoginForm = Form.create()(Search)
        return (
            <div className="login-container">
                <div className="login-content">
                    <AntWrappedLoginForm />
                </div>
            </div>
        );
    }
}






class Search extends Component {
  constructor(props) {
    super(props);
    this.state = {
     marks: {
        0: '$10',
        100: '$150'
      },
      dataSource: [],
    }
  }

  handleSearch = (value) => {
    this.setState({
      dataSource: !value ? [] : [
        value,
        value + value,
        value + value + value,
      ],
    });
  }

  onSelect(value) {
    console.log('onSelect', value);
  }


  handleSubmit = name => event => {
      this.setState({
        [name]: event.target.value,
      });
    };

    onChange(value) {
      let newVal = "$"+value;
      this.setState({
        marks: {
          0: '$10',
          100: newVal
          }
        })
    }

    onDateChange(date, dateString) {
      console.log(date);
      console.log(dateString);
    }

  render() {
    const services = [
      "Dog Boarding", "Dog Sitting", "Dog Pooping"
    ]
    function handleChange(value) {
      console.log(value);
    }
    return (

      <div>
      <h3> Find A Sitter </h3>
      <Form>
      <div>
      <p className="service-label">Service</p>
      </div>
      <Form.Item>
        <Select
          size="large"
          name="role"
          autoComplete="off"
        style={{ width: '100%' }}
        defaultValue={['Dog Boarding']}
        onChange={handleChange}
        >
        {services.map(service => <Option key={service}>{service}</Option>)}

        </Select>
        </Form.Item>
        <div className="slider-label">
        <p>Rate</p>
        </div>
        <Form.Item>
         <Slider
         marks={this.state.marks}
         defaultValue={150}
          tipFormatter={(value) => `$${value}`}
          onChange={this.onChange.bind(this)}/>
         </Form.Item>
         <div className="dates-label">
          <p>Service</p>
          </div>
            <Form.Item>
         <DatePicker.RangePicker
         className="date-picker"
          onChange={this.onDateChange.bind(this)}
          placeholder={['Drop off', 'Pick up']}
          />
         </Form.Item>
         <AutoComplete
           dataSource={this.state.dataSource}
           style={{ width: 200 }}
           onSelect={this.onSelect}
           onSearch={this.handleSearch}
           placeholder="input here"
     />




        </Form>
        </div>


    );
  }
}


export default SearchForm;
